import  React, {Component} from 'react';
import axios from 'axios'

import './css/milk.css';


export default  class addResource extends  Component{


    constructor(props) {
        super(props);
    }

    render() {
        return(
                <div>
                     <div>
                        <h2 style={{background:'#349beb',padding:10, color:'white'}}>Business Inventory System at Nalin Enterprises (PVT LTD)</h2>
                     </div>
                     <div class="sidebar">
                        <br/>
                        <center>
                           <img src = "https://www.pngall.com/wp-content/uploads/5/Profile-Male-PNG.png" width="100"/>
                           <br/>
                           <h6>{this.props.match.params.id}</h6>
                        </center>
                        
                        <a href= "">Bill</a>
                        <a href="">Stock</a>
                        <a href="/">Financial</a>
                        <a href="/">Resource</a>
                        <a href="/">Employee</a>
                        <a href="/">Sales</a>
                        <a href="/">Marketinh</a>
                        <a href="">Payment</a>
                    </div>

                    <div class="content">

                        <br/>
                        <h3 align="center">Customer Payment Form</h3>
                       
                        <br/> <br/> <br/>
                        <div className="container" style={{marginLeft:300}}>
                        </div>
                        
                    </div>
                </div>
        );
    }
}
